  `modify_time` datetime(6) NULL DEFAULT NULL COMMENT '修改时间',
  `end_time` datetime(6) NULL DEFAULT NULL COMMENT '结束时间',
  `create_user` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '创建人',
  `stock` int NULL DEFAULT NULL COMMENT '人数',
  `is_del` int NOT NULL DEFAULT 0 COMMENT '‘0’数据有效，‘1’已删除',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 6 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci ROW_FORMAT = DYNAMIC;

